import Foundation
import Kingfisher

struct ImageChecker {
    func downloadAll(into imageView: UIImageView) {
        KingfisherManager.shared.cache.clearMemoryCache()
        KingfisherManager.shared.cache.clearDiskCache(completion: nil)
        KingfisherManager.shared.cache.memoryStorage.config.countLimit = 10 * 1024 * 1024
        
        var index = 0
        func downloadNext() {
            guard index < images.count else {
                print("AAAA Finished")
                return
            }
            let url = images[index]
            print("AAAA Downloading -> \(index) \(url)")
            index += 1
            imageView.kf.setImage(with: URL(string: url)!, placeholder: nil, options: [.processor(BlurImageProcessor(blurRadius: 5)), .keepCurrentImageWhileLoading]) { result in
                switch result {
                case .success:
                    print("AAAA Finished -> \(index) \(String(describing: url))")
                case let .failure(error):
                    print("AAAA Error -> \(index) \(String(describing: url)) -> \(error)")
                }
                downloadNext()
            }
        }
        downloadNext()
    }
    
